import React from "react";

const CartItem = ({ name, price, quantity, img }) => {
  return (
    <div className="cart--modal__item">
      <h4>{name}</h4>
      <img
        src={require(`${img}`)}
        alt="product"
        width={"150px"}
        border-radius={"20px"}
      />
      <strong>{price}</strong>
      <strong>{quantity}</strong>
    </div>
  );
};

export default CartItem;
